import { all } from "redux-saga/effects";

import { loginSaga, logoutSaga } from './auth/login/saga'
import { fetchDriverSaga, addDriverSaga ,confirmDeleteDriverSaga} from './driver/saga'


export default function* rootSaga() {
    yield all([
        loginSaga(),logoutSaga(), fetchDriverSaga(), addDriverSaga(),confirmDeleteDriverSaga()
    ]);
}
